-- Дамп структуры для процедура hobbygames.get_delivery_adress
DROP PROCEDURE IF EXISTS `get_delivery_adress`;
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `get_delivery_adress`(order_id BIGINT)
BEGIN
	DECLARE type_delivery VARCHAR(10);SELECT delivery_type FROM orders WHERE orders.id = order_id LIMIT 1 INTO type_delivery;CASE type_delivery
	    WHEN 'user' THEN
	      SELECT ua.adress FROM orders AS o
			JOIN users_adresses AS ua
			ON delivery_adress_id = ua.id;WHEN 'shop' THEN 
	      SELECT s.adress FROM orders AS o
			JOIN shops AS s
			ON delivery_adress_id = s.id
			WHERE o.id = order_id;ELSE 
	      SIGNAL SQLSTATE "45000"
    		SET MESSAGE_TEXT = "Error getting adress!";END CASE;END//
DELIMITER ;


-- Дамп структуры для процедура hobbygames.product_min_price
DROP PROCEDURE IF EXISTS `product_min_price`;
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `product_min_price`()
BEGIN
SELECT id, final_price
FROM (
    SELECT
    	 p.id,
		 MAX(d.discount) AS discount,
		 IF(ISNULL(discount), p.price, FLOOR((1 - discount) * p.price)) AS final_price
	 FROM products AS p
	 LEFT JOIN products_by_categories AS pc
	 ON p.id = pc.product_id
	 LEFT JOIN discounts AS d
	 ON (p.id = d.product_id OR pc.category_id = d.category_id)
	 	AND
	 	(ISNULL(d.started_at) OR (d.started_at < NOW() AND d.finished_at > NOW()))
	 GROUP BY p.id
) AS product_final_price
WHERE final_price < 1000;END//
DELIMITER ;


-- Дамп структуры для функция hobbygames.is_row_exists
DROP FUNCTION IF EXISTS `is_row_exists`;
DELIMITER //
CREATE DEFINER=`root`@`localhost` FUNCTION `is_row_exists`(delivery_type VARCHAR(50), delivery_adress_id INT) RETURNS tinyint(1)
    READS SQL DATA
BEGIN
	IF delivery_type = 'user' THEN
      RETURN EXISTS(SELECT 1 FROM users_adresses WHERE id = delivery_adress_id);ELSE
		RETURN EXISTS(SELECT 1 FROM shops WHERE id = delivery_adress_id);END IF;END//
DELIMITER ;


-- Дамп структуры для триггер hobbygames.adress_id_validation
DROP TRIGGER IF EXISTS `adress_id_validation`;
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_ALL_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER';
DELIMITER //
CREATE TRIGGER `adress_id_validation` BEFORE INSERT ON `orders` FOR EACH ROW BEGIN
  IF !is_row_exists(NEW.delivery_type, NEW.delivery_adress_id) THEN
    SIGNAL SQLSTATE "45000"
    SET MESSAGE_TEXT = "Error adding order! Provided adress id doesn't exist!";END IF;END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;


-- Дамп структуры для представление hobbygames.products_by_categories
DROP VIEW IF EXISTS `products_by_categories`;
-- Удаление временной таблицы и создание окончательной структуры представления
DROP TABLE IF EXISTS `products_by_categories`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `products_by_categories` AS select `p`.`id` AS `product_id`,`p`.`name` AS `product`,`c`.`id` AS `category_id`,`c`.`name` AS `category` from ((`products` `p` left join `products_categories` `pc` on((`p`.`id` = `pc`.`product_id`))) left join `categories` `c` on((`pc`.`category_id` = `c`.`id`))) order by `p`.`name`;


-- Дамп структуры для представление hobbygames.products_wishes_count
DROP VIEW IF EXISTS `products_wishes_count`;
-- Удаление временной таблицы и создание окончательной структуры представления
DROP TABLE IF EXISTS `products_wishes_count`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `products_wishes_count` AS select `p`.`name` AS `product`,count(`wp`.`product_id`) AS `total_wished` from (`products` `p` left join `wishlists_products` `wp` on((`p`.`id` = `wp`.`product_id`))) group by `p`.`id` order by `total_wished` desc,`p`.`name`;
